import React from "react";

class EditFishForm extends React.Component {
    render() {
        return (
            <p className="fish-edit">
                <input type="text" name="name"></input>
                <input type="text" name="price"></input>
                <select></select>
            </p>
        )
    }
}

export default EditFishForm
